CREATE PROCEDURE dbo.proc_transform_473
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_473
    SET payload = LEFT(payload, 1000) + N'|V4-473|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_473;
END
